DECLARE

err_msg    VARCHAR2(255);

  CURSOR CUR_ACTUALIZA IS
        SELECT
             CAST(REGEXP_REPLACE(T1.ICCID , '[^0-9]+', '') AS NUMBER) AS ICCID
            ,CAST(REGEXP_REPLACE(SUBSTR(T1.ICCID,1,19) , '[^0-9]+', '') AS NUMBER) AS ICCID_PARA_ODI 
            ,CAST(REGEXP_REPLACE(T2.ICCID_BSCS , '[^0-9]+', '') AS NUMBER) AS ICCID_BSCS
            ,T1.DN_NUM
            ,SK_ESTADO_BENEFI
        FROM <?=odiRef.getObjectName("MINTIC_DATA_BSCS_TMP_TB") ?> T1
        JOIN <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> T2
        ON (T1.DN_NUM = T2.MIN)
        WHERE T2.SK_ESTADO_BENEFI IN (1,3)
        AND CASE CAST( REGEXP_REPLACE (TO_CHAR(T1.ICCID),'[^0-9]+','') AS NUMBER) 
            WHEN CAST( REGEXP_REPLACE (TO_CHAR(T2.ICCID_BSCS),'[^0-9]+','') AS NUMBER) THEN 'BIEN' ELSE 'MAL' END ='MAL'      
          ;

    v_Reg_Actualiza            CUR_ACTUALIZA%ROWTYPE;
    v_Nro_Actualiza            PLS_Integer; 

BEGIN

   OPEN CUR_ACTUALIZA;
   v_Nro_Actualiza := 0;

  LOOP
    FETCH CUR_ACTUALIZA INTO v_Reg_Actualiza;
    EXIT WHEN CUR_ACTUALIZA%NOTFOUND;
    BEGIN  
        IF v_Reg_Actualiza.DN_NUM IS NOT NULL THEN
            UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> T1
               SET T1.ICCID_BSCS = v_Reg_Actualiza.ICCID
                  ,T1.ICCID = v_Reg_Actualiza.ICCID_PARA_ODI
                  ,FECHA_ESTADO = SYSDATE
             WHERE T1.MIN = v_Reg_Actualiza.DN_NUM;
             COMMIT;
        END IF;
    END;
    END LOOP; 
  CLOSE  CUR_ACTUALIZA;   
  COMMIT;
END;

DECLARE
  CURSOR CUR_Beneficiario IS
        SELECT
            *
        FROM (
        SELECT
             T1.CO_ID
            ,T1.CUSTOMER_ID
            ,CASE
                WHEN SUBSTR(T1.CUSTCODE,1,INSTR(T1.CUSTCODE,'.',1,2)-1) = SUBSTR(T2.CUSTCODE,1,INSTR(T2.CUSTCODE,'.',1,2)-1) THEN 'OK' ELSE 'MAL' END VALIDA
            ,T1.DN_NUM
            ,SUBSTR(T1.CUSTCODE,1,INSTR(T1.CUSTCODE,'.',1,2)-1) AS CUST_BSCS
            ,SUBSTR(T2.CUSTCODE,1,INSTR(T2.CUSTCODE,'.',1,2)-1) AS CUST_BENE
            ,T2.SK_ESTADO_BENEFI
        FROM <?=odiRef.getObjectName("MINTIC_DATA_BSCS_TMP_TB") ?> T1
        JOIN <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> T2
        ON (T1.DN_NUM = T2.MIN)
        WHERE SK_ESTADO_BENEFI IN (4)
        )
        WHERE VALIDA = 'MAL'; 


  v_Nro_Registros     PLS_INTEGER;
BEGIN
  v_Nro_Registros := 1;
  FOR Datos IN CUR_Beneficiario LOOP
    IF Datos.DN_NUM IS NOT NULL THEN
      UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?>
         SET  SK_ESTADO_BENEFI = 6
             ,FECHA_ESTADO = SYSDATE               
       WHERE MIN = Datos.DN_NUM  
       AND SK_ESTADO_BENEFI IN (4)
      ;
      v_Nro_Registros := v_Nro_Registros + 1;

      IF MOD (v_Nro_Registros, 5000) =  0 THEN
        COMMIT;
      END IF;
    END IF;
  END LOOP;
  COMMIT;
END;

DECLARE CURSOR CUR_Beneficiario IS SELECT B.MIN IDT ,CASE WHEN M.PROCESS_RESULT = '1' AND BS.CO_ID IS NULL THEN -1 WHEN M.PROCESS_RESULT = '1' AND SUBSTR(BS.CS_STAT_CHNG,-1) = 'd' THEN 6 WHEN M.PROCESS_RESULT = '1' OR BS.CO_ID IS NOT NULL THEN 10 --1 lina.torres se modifica para validacion tickler WHEN M.PROCESS_RESULT = '0' THEN 4 ELSE 6 END Nuevo_Estado ,CASE WHEN BS.CO_ID IS NOT NULL THEN BS.ID_CAUSAL ELSE B.CAUSAL_ACTIVACION END Causal_Activacion ,CASE WHEN M.PROCESS_RESULT = '0' THEN M.PROCESS_DESCRIPTION ELSE 'N/A' END Causal_Desactivacion ,TO_NUMBER(NVL(BS.CO_ID,-1 )) CO_ID ,NVL(BS.CUSTCODE,'-1') AS CUSTCODE ,TO_NUMBER(NVL(BS.CUSTOMER_ID,-1)) CUSTOMER_ID ,CASE WHEN CAST(TO_CHAR(TO_DATE(BS.CS_ACTIV_DATE,'YYYY/MM/DD HH24:MI:SS'),'DD/MM/YYYY HH24:MI:SS')AS DATE) IS NULL THEN SYSDATE ELSE CAST(TO_CHAR(TO_DATE(BS.CS_ACTIV_DATE,'YYYY/MM/DD HH24:MI:SS'),'DD/MM/YYYY HH24:MI:SS')AS DATE) END AS CS_ACTIV_DATE ,NVL(CAST(REGEXP_REPLACE(BS.ICCID, '[^0-9]+', '') AS NUMBER),-1) ICCID FROM <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> B LEFT JOIN <?=odiRef.getObjectName("MINTIC_MASSIVE_ACTIVA_TMP_TB") ?> M ON (TO_CHAR(B.MIN) = TO_CHAR(REPLACE(TRIM(M.CODMIN),CHR(13),''))) LEFT JOIN <?=odiRef.getObjectName("MINTIC_DATA_BSCS_TMP_TB") ?> BS ON (TRIM(BS.DN_NUM) = TRIM(B.MIN)) WHERE (M.CODMIN IS NOT NULL OR BS.DN_NUM IS NOT NULL) AND SK_ESTADO_BENEFI IN (6,4) --AND BS.CO_ID IS NOT NULL ;
v_Nro_Registros PLS_INTEGER; BEGIN v_Nro_Registros := 1; FOR Datos IN CUR_Beneficiario LOOP IF Datos.IDT IS NOT NULL AND Datos.NUEVO_ESTADO != 6 THEN UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> SET SK_ESTADO_BENEFI = Datos.Nuevo_Estado ,CAUSAL_ACTIVACION = Datos.Causal_Activacion ,CAUSAL_DESACTIVACION = Datos.Causal_Desactivacion ,CO_ID = Datos.CO_ID ,CUSTCODE = Datos.CUSTCODE ,CUSTOMER_ID = Datos.CUSTOMER_ID ,FECHA_ESTADO = Datos.CS_ACTIV_DATE ,ICCID_BSCS = Datos.ICCID WHERE MIN = Datos.IDT AND SK_ESTADO_BENEFI IN (6,4) ; v_Nro_Registros := v_Nro_Registros + 1;
IF MOD (v_Nro_Registros, 5000) = 0 THEN COMMIT; END IF; END IF; END LOOP; COMMIT; END;

DECLARE

err_msg    VARCHAR2(255);

  CURSOR CUR_DUPLICADO IS
        SELECT
             SK_ESTADO_BENEFI
            ,MIN
            ,FEC_ESTADO_BSCS
            ,F_ESTADO_ACTUAL
            ,F_ESTADO_ANTERIOR
            ,CS_STAT_CHNG
            ,ID_CAUSAL
            ,ESTADO_BSCS
        FROM <?=odiRef.getObjectName("MINTIC_ACTUALIZA_ICCID_TMP_TB") ?>;


    v_Reg_Duplicados            CUR_DUPLICADO%ROWTYPE;
    v_Nro_Duplicados            PLS_Integer; 

BEGIN
   OPEN CUR_DUPLICADO;
   v_Nro_Duplicados := 0;

  LOOP
    FETCH CUR_DUPLICADO INTO v_Reg_Duplicados;
    EXIT WHEN CUR_DUPLICADO%NOTFOUND;
    BEGIN  
        IF v_Reg_Duplicados.MIN IS NOT NULL THEN
            UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> A
			SET A.SK_ESTADO_BENEFI = v_Reg_Duplicados.ESTADO_BSCS
			,A.FECHA_ESTADO = v_Reg_Duplicados.FEC_ESTADO_BSCS
			,A.CAUSAL_DESACTIVACION = v_Reg_Duplicados.ID_CAUSAL
			WHERE A.MIN = v_Reg_Duplicados.MIN;
            COMMIT;
        END IF;
    END;
    END LOOP; 
  CLOSE  CUR_DUPLICADO;   
  COMMIT;
END;
